rd is based on GDP at market prices with FY2011/12 as a base year.<br>\n6/ Indonesia, Malaysia, Philippines, Thailand,  Vietnam.<br>\n7/ Simple average of prices of U.K. Brent, Dubai Fateh, and West Texas Intermediate crude oil. The average price of oil in U.S. dollars a barrel was $50.92 in 2015; the assumed price based on futures markets (as of December 10, 2015) is $41.97 in 2016 and $48.21 in 2017.</small></td></tr></tbody></table>
52c1285e-109c-4bd3-8985-a36fbe74ce55	Announcement: Moody's: Muted global growth for another two years undermines resilience to negative shocks  The document has been translated in other languages\n\nGlobal Credit Research - 10 Nov 2015\n\nLondon, 10 November 2015 -- Global growth will be lacklustre over the next two years as the slowdown in China and other emerging markets continues to weigh on the world economy, Moody's Investors Service said in a report published today.\n\nMoody's forecasts that G20 GDP growth will average 2.8% in 2015-17, only 0.3 percentage point higher than in 2012-14 and below the 3.8% average recorded in the five years before the global financial crisis. The rating agency's latest forecasts are broadly unchanged from its last quarterly Global Macro Outlook in August.\n\n"Muted global economic growth will not support a significant reduction in government debt or allow central banks to raise interest rates markedly," said the report's author Marie Diron, Senior Vice President, Credit Policy. "Authorities lack the large fiscal and conventional monetary policy buffers to protect their economies from potential shocks."\n\nThe report, "Global Macro Outlook 2015-17: Lacklustre Global Economic Recovery Through 2017 Diminishes Resilience to Shocks", is now available on www.moodys.com. Moody's subscribers can access this report via the link at the end of this press release. The research is an update to the markets and does not constitute a rating action.\n\nG20 GDP growth is forecast to rise slowly to 2.8% in 2016 and 3% in 2017 from 2.6% in 2015. Emerging markets' contribution to G20 GDP growth in 2015-17 will fall to the lowest levels since the early 2000s. The combination of persistently low commodity prices and subdued global growth will maintain disinflationary pressures, weigh on revenues and hamper attempts to deleverage.\n\nThe main risks to the economic outlook would stem from a bigger than expected global fallout from the Chinese slowdown and a larger impact from tighter external and domestic financing conditions in other emerging markets.\n\n"The direct effects on the global economy from both of these potential risks would likely be limited," Ms Diron adds. "However, advanced economies would be unable to do much to shore up global growth, given policymakers' limited room for manoeuvre on fiscal and monetary policy and the high leverage we're seeing in a number of sectors and countries."\n\nIn China, Moody's forecasts GDP growth of just under 7% in 2015, 6.3% in 2016 and 6.1% in 2017. The gradual economic slowdown reflects a trade-off between further reforms - aimed at lessening the economy's dependence on investment and credit and increasing the influence of market mechanisms -- and the risk of jeopardising employment and social stability.\n\nCommodity prices are unlikely to rise significantly in the next few years. A large inventory build-up, a slow supply response and muted demand from China and other key importers will all weigh on prices.\n\nMoody's expects no significant rise in prices for energy, metal and mining commodities in the next two years. For commodity producers, the economic effects of low commodity prices will spill over into other sectors through supply chains and weaker growth in household income.\n\nAs well as weaker commodity prices, a range of country-specific factors will contribute to lower growth in emerging markets and could lead investors to reassess growth and return prospects in some countries. For example, political uncertainty will be a negative factor in Brazil and Russia and infrastructure shortages will hamper growth in South Africa.\n\nSlow growth in emerging markets will not derail growth in advanced economies, where the economic outlook is likely to be supported by more accommodative monetary policy in the years ahead. Growth is expected to be broadly stable in the US, Europe and Japan. For 2015-17, Moody's forecasts average GDP growth at around 2.5% in the US, the UK and Korea and 1.5% for the euro area.\n\nMoody's Global Macro Outlook report underpins the company's ratings and provides a consistent benchmark for analysts and investors.\n\nMoody's subscribers can access this report at: http://www.moodys.com/researchdocumentcontentpage.aspx?docid=PBC_1009471\n\nNOTE TO JOURNALISTS ONLY: For more information, please call one of our global press information hotlines: New York +1-212-553-0376, London +44-20-7772-5456, Tokyo +813-5408-4110, Hong Kong +852-3758-1350, Sydney +61-2-9270-8141, Mexico City 001-888-779-5833, São Paulo 0800-891-2518, or Buenos Aires 0800-666-3506. You can also email us at mediarelations@moodys.com or visit our web site at www.moodys.com.\n\nThis publication does not announce a credit rating action. For any credit ratings referenced in this publication, please see the ratings tab on the issuer/entity page on www.moodys.com for the most updated credit rating action information and rating history.\n\nMarie Diron\nSenior Vice President\nCredit Policy\nMoody's Investors Service Ltd.\nOne Canada Square\nCanary Wharf\nLondon E14 5FA\nUnited Kingdom\nJOURNALISTS: 44 20 7772 5456\nSUBSCRIBERS: 44 20 7772 5454\nColin Ellis\nManaging Director\nCredit Policy\nJOURNALISTS: 44 20 7772 5456\nSUBSCRIBERS: 44 20 7772 5454\nReleasing Office:\nMoody's Investors Service Ltd.\nOne Canada Square\nCanary Wharf\nLondon E14 5FA\nUnited Kingdom\nJOURNALISTS: 44 20 7772 5456\nSUBSCRIBERS: 44 20 7772 5454\n
b466323f-d479-49a2-9e1d-975a950736e3	Польша станет полноправным членом НАТО летом текущего года, заявил министр обороны страны Антоний Мацаревич. По его словам, характер присутствия страны в Североатлантическом альянсе изменится после саммита организации в Варшаве, который состоится 8-9 июля, передает «Радио Польша».\n\n«Польша стоит на пороге большого изменения, каким является переход от политического участия в НАТО к полноправному членству», — заявил Мацеревич. Он подчеркнул, что не только правительство и вооруженные силы страны, но и вся нация выступает за единство с союзниками для защиты от возможной агрессии, независимо с какой стороны она последует.\n\nМинистр также отметил, что в текущем году в Польше «пройдет важнейшее событие свободного мира — саммит НАТО в Варшаве». «Он закончит долгий путь и сделает Польшу и другие страны Восточной и Центральной Европы полноправными членами альянса», — добавил министр.\n\nВ феврале генсек НАТО Йенс Столтенберг заявил, что министры обороны стран-членов альянса собираются расширить военный контингент в Восточной Европе на границах с Россией. Речь идет о размещении шести тысяч военнослужащих НАТО. Этот контингент не будет постоянным, он будет подвергаться ротации. Окончательное решение будет принято в июле этого года.\n\n11 января Мацаревич назвал Польшу «фронтовым» государством, которое нуждается в размещении баз НАТО. 5 января он выразил мнение, что Варшава должна почти вдвое увеличить численность своих вооруженных сил, чтобы противостоять военным угрозам.\n\nОн также заявил, что на саммите НАТО в Варшаве будет определено, является ли Польша, которая состоит в НАТО c марта 1999 года, «равноправным» членом альянса, или же ее рассматривают как «государство второй категории». Мацаревич отметил, что пока в отношении страны действует «немецкое вето».
110e7ce4-7709-41f7-841a-c1da8bca0a6f	Строительство российского газопровода "Северный поток-2" который будет поставлять газ в Европу в обход Украины, может начаться в 2018 году.\n\nОб этом со ссылкой на сообщение компании Nord Stream 2 AG, передает "Прайм".\n\nКак отмечается, Nord Stream 2 AG завершила тендер на поставку стальных труб для строительства двух ниток газопровода "Северный поток-2".\n\nВ качестве поставщиков были выбраны немецкая Europipe Gmbh, АО "Объединенная металлургическая компания" и ОАО "Челябинский трубопрокатный завод".\n\nВ сообщении подчеркивается, что оперативное завершение тендера является главным условием соблюдения графика строительства газопровода. Начало работ запланировано на 2018 года, поставка труб начнется уже в сентябре 2016 года.\n\nНапомним, что депутаты Европейского парламента призвали государства-члены ЕС отказаться от строительства газопроводов в обход Украины, в частности, российского газопровода "Северный поток-2".
8bfe5a51-0617-4ffc-8fa5-b8321c8b0e8c	Рейтинговое агентство Standard & Poor's прогнозирует сокращение ВВП России на 1,4 процента в 2016 году, передает Rambler News Service. На 2017-й планируется возвращение к «скромному» положительному росту, а всего в 2016-2019 годах экономика должна расти в среднем на 0,5 процента.\n\nВВП на душу населения по текущим обменным курсам, как считает S&P, составит в 2016 году 7700 долларов.\n\n18 марта S&P подтвердило долгосрочный и краткосрочный суверенные кредитные рейтинги страны по обязательствам в иностранной валюте на уровне ВВ+/В, а также долгосрочный и краткосрочный суверенные кредитные рейтинги по обязательствам в национальной валюте на уровне ВВВ–/А-3.\n\n7 марта международное рейтинговое агентство Fitch ухудшило свой прогноз по российской экономике на 2016 год. Теперь вместо роста в 0,5 процента аналитики ожидают сокращения ВВП на 1,5 процента.\n\n3 марта Банк России в своем докладе назвал туманными перспективы восстановления российской экономики. В Центробанке ожидают, что в первом квартале 2016 года ВВП России упадет на 0,3 процента, во втором будет нулевой рост, в третьем — увеличение на 0,2-0,3 процента (по сравнению с аналогичными кварталами 2015 года).
a8434282-4f61-431f-bc5c-229212c6bf9f	Премьер-министр Украины Арсений Яценюк окончательно согласился написать заявление об отставке, пишет «Апостроф» со ссылкой на свои источники. По данным издания, новым главой кабинета, скорее всего, будет нынешний председатель Верховной Рады Владимир Гройсман.\n\nВ понедельник, 21 марта, председатель фракции «Блок Петра Порошенко» (БПП) Юрий Луценко заявил, что внеочередное заседание Верховной Рады, где может быть рассмотрен вопрос о правительстве, имеет шансы состояться уже в четверг, 24 марта.\n\nПо словам Луценко, продолжаются переговоры о том, чтобы договориться о формировании правительства по квотному принципу, как того требует «Народный фронт» Яценюка. По данным издания, на прошлых выходных в непростых переговорах между командами президента и премьера состоялся прорыв, и Яценюк согласился передать руководство правительством новому главе.\n\nСообщается, что премьер согласен на отставку при условии, что в правительстве за его политической силой останутся два министерства — внутренних дел и юстиции, которые возглавят, соответственно, нынешние министры — Арсен Аваков и Павел Петренко. Кроме того, Народный фронт потребовал себе должность председателя Рады.\n\nПо утверждению источника, заявить о своей отставке Яценюк должен уже в ближайшую среду, 23 марта, на заседании правительства. Именно в этот день должен состояться съезд БПП, на котором делегаты, скорее всего, должны поддержать кандидатуру Гройсмана на пост премьера.\n\nТакже известно, что стороны договорились о сохранении Натальи Яресько на посту главы Минфина в будущем правительстве Гройсмана.\n\nЧто касается дальнейшей деятельности Яценюка, то, как сообщил источник, у него было желание возглавить Нацбанк, но договоренности об этом достичь так и не удалось.\n\nДискуссия о смене премьера активно ведется на Украине с прошлого месяца. 16 февраля Рада не смогла принять резолюцию о недоверии правительству, которая влечет за собой его отставку. В тот же день президент Петр Порошенко заявил, что правительство полностью потеряло поддержку со стороны парламентской коалиции.\n\nВ марте глава государства заявил, что среди претендентов на пост Яценюка видит Яресько и мэра Львова Андрея Садового. Последний от предложения отказался.\n\nСам Яценюк заявлял, что готов уйти в отставку, если парламент наберет необходимое количество голосов для утверждения нового главы кабмина.
0bb8c581-a1c7-4478-8dc3-048052113668	Рубль, демонстрировавший уверенный рост на прошлой неделе, снова теряет свои позиции. Доллар отступил от минимальных в этом году значений и поднимался к отметке в 68,80 рубля. Российская валюта слабела на фоне падения нефтяных котировок. Ситуацию изменила всего одна буровая установка в США.\n\nУдарная неделя\n\nЗа неделю, с 14 по 18 марта, доллар подешевел на 5 процентов: с 70,81 до 67,36 рубля. До минимальных значений в 2016 году американская валюта упала на фоне новостей на финансовом и сырьевом рынках.\n\nВо-первых, на минувшей неделе состоялись заседания Комитета по открытым рынкам ФРС США (16 марта) и Совета директоров Банка России (18 марта). Федрезерв не стал рисковать и отказался от ужесточения монетарной политики, то есть от повышения базовой ставки. Центробанк также проявил осторожность и не смягчил свою линию, сохранив ключевую ставку на уровне 11 процентов. Решение американского регулятора привело к ослаблению доллара, российского — к укреплению рубля.\n\nВо-вторых, 16 марта стала известна дата встречи стран-производителей нефти. 17 апреля в катарской столице Дохе 15 государств проведут переговоры о заморозке добычи черного золота. По оценке главы Минэнерго России Александра Новака, соответствующее соглашение уберет с рынка 1,3 миллиона баррелей нефти в сутки. Ранее специалисты приводили расчеты, согласно которым обвал котировок на 70 процентов произошел как раз из-за переизбытка предложения объемом 1,5-2 миллиона бочек в день. Нефть марки Brent за 7 дней выросла в цене с 38,95 до 42,37 доллара на пике (плюс 9 процентов).\n\n\nНа пике\nКак долго будет укрепляться рубль\nВ общем, прошлая неделя была богата на события, влияющие на динамику рубля. И это наглядно демонстрирует то, что российская валюта действительно представляет собой полноценный рыночный инструмент со свободно формируемой ценой. «Рублю оказывали поддержку ожидания от переговоров ОПЕК и России, которые состоятся 17 апреля, снижение доллара после решения ФРС о сохранении ставки и подготовка к налоговому периоду в России. Дополнительные факторы: решение ЦБ РФ временно не смягчать денежно-кредитную политику и отсутствие ажиотажа вокруг роста доллара — все самое худшее в плане макроэкономики уже и так реализовалось», — прокомментировал директор аналитического департамента инвесткомпании «Golden Hills-КапиталЪ АМ» Михаил Крылов.\n\n«Сохранение Центробанком ключевой ставки в определенной степени помогло, но не было главным козырем для рубля. Если бы ставку чуть понизили, то рубль сильно бы не пострадал. Сейчас рынку важны не решения Банка России, а внешние факторы — нефть плюс геополитика», — отмечает замдиректора аналитического департамента инвестиционной компании «Окей Брокер» Сергей Алин.\n\nСила вышки\n\nСтоль бодрый подъем национальной валюты прервался в понедельник, 21 марта. В первые часы торгов на лондонской бирже ICE стоимость нефти марки Brent упала с 41,14 до 40,50 долларов. Рубль, крепко привязанный к цене углеводородов, отреагировал соответствующим образом. Американская валюта подорожала до 68,80 рубля.\n\nОдна из причин проседания нефтяных котировок — статистика по активным буровым установкам в Соединенных Штатах. По информации компании Baker Hughes, их число выросло до 387. За неделю — всего на единицу, но и этого хватило, чтобы надавить на сырьевой рынок. Ранее количество буровых установок в США неуклонно снижалось: в начале января 2015 года их было 1421, через 12 месяцев — уже 516. Статистика Baker Hughes оказывала определенное воздействие на ценовые показатели, поскольку закрытие вышек может косвенно свидетельствовать о сокращении добычи, а значит — и уменьшении объема предложения. Активизация 387-й установки говорит о наращивании производства, поэтому цены и двинулись вниз.\n\nДоллар отступил от годовых минимумов и 21 марта поднимался к 68,80 рубля \n\nТем не менее не стоит ожидать, что динамика по нефтяным вышкам в США серьезно повлияет на сырьевые цены. Глобальное положение на энергетическом и валютном рынках определяется долгосрочными тенденциями. Рубль зависит именно от них. Недаром в середине дня 21 марта нефть вернулась к росту и к 16:00 мск закрепилась на уровне выше 41 доллара за баррель. За доллар при этом давали около 68 рублей.\n\n«Статистика о росте числа буровых установок в США добавила свой вклад в текущее движение, но скорее выглядит, как притянутый повод и не может рассматриваться всерьез, поскольку число работающих установок за неделю выросло на одну единицу», — утверждает аналитик Nordea Bank Денис Давыдов. По его мнению, рынок продолжит следовать за статистикой из Соединенных Штатов и Китая, а нефтяные котировки будут колебаться в рамках 38-42 доллара за баррель.\n\nБудущее доллара\n\nВ ближайшее время на курс рубля будут влиять не только глобальные события, но и внутренние, связанные с экономическими процессами в России.\n\n«В течение месяца мы прогнозируем стабилизацию цен на нефть в пределах 35-40 долларов за баррель, и пары доллар/рубль — в рамках 70-80», — говорит Михаил Крылов из «Golden Hills-КапиталЪ АМ». В ближайшее время российскую валюту поддержит налоговый период в РФ (компаниям придется исполнять свои обязательства в рублях, спрос на них на рынке вырастет вместе с курсом; пик платежей придется на 25 марта), а также улучшение ожиданий по инфляции, продолжает аналитик.\n\nС другой стороны, есть негативные факторы: замедление темпов сокращения добычи нефти в США, ожидание плохого спроса на черное золото, растущие шансы на повышение базовой ставки ФРС — все это сделает доллар более дорогим. Михаил Крылов прогнозирует, что в конце марта американская валюта будет стоить 70-75 рублей, в апреле — 75-80 рублей, евро — 75,8-80,8 и 78,9-83,9 соответственно.\n\nПо мнению аналитика группы компаний «Финам» Богдана Зварича, в ближайшие дни Brent может опуститься ниже уровня 40 долларов, что окажет давление на рубль. «Основным же позитивным фактором для российской валюты сейчас является налоговый период, когда компании продают валюту для создания рублевых резервов, которые в дальнейшем пойдут на налоговые выплаты. Это сохраняет спрос на рубли и в случае негативных настроений на валютном рынке сдержит ослабление национальной валюты», — добавил он.\n\n«На текущей неделе мы ожидаем продолжение укрепления российского рубля. Курс доллара вполне может снизиться до 67 рублей, евро — до 75,50 рубля», — полагает Сергей Алин из «Окей Брокер».\n\nГрядущая неделя на финансовом рынке обещает быть спокойной \nГрядущая неделя на финансовом рынке обещает быть спокойной\nФото: Stefan Wermuth / Reuters\nДействительно, грядущая неделя обещает быть относительно спокойной. По крайней мере, крупных событий (вроде заседания ФРС США) не ожидается. Если оставить за скобками возможные экстренные обстоятельства, то можно говорить о том, что в ближайшее время волатильность рубля снизится. Более того, есть вероятность некоторого укрепления. Недаром международные банки считают российскую валюту недооцененной. Об этом 2 марта говорили в Deutsche Bank, 21 марта — в Goldman Sachs. Аналитики Goldman Sachs полагают, что в ближайшие три месяца за американскую валюту будут давать 70 рублей, через полгода — 66 рублей, через год — 62 рубля.\n
