c7c9caa5-99d2-4e3a-b558-a1af140e7471	Почему Банк России лихорадочно скупает золото\n\n\nВ феврале 2016 года Банк России стал крупнейшим покупателем золота среди мировых центробанков. На первый взгляд, это выглядит странно, ведь по прогнозам аналитиков, цена на желтый металл, скорее всего, будет падать. Но дело, скорее всего, не в прибылях или убытках. В золото активно вкладываются, когда ждут беды. В данном случае — серьезного ухудшения экономической ситуации.\n\nПокупатели и продавцы\n\nРоссийский Центробанк, по последним данным Международного валютного фонда (МВФ), за месяц выкупил с рынка 356 тысяч унций (чуть более 11 тонн) золота. Если верить сведениям Народного банка Китая, Банк России занял по закупкам второе место, приобретя около 320 тысяч унций (почти 10 тонн). Впрочем, особенно доверять данным регулятора КНР не стоит: китайская статистика — одна из самых непрозрачных и далеких от действительности. От реальности может отличаться в разы. Известно только, что Народный банк, серьезно затоварившийся американскими гособлигациями, теперь стремится диверсифицировать вложения и инвестирует в другие инструменты. Кроме того, продолжает наращивать запасы золота Казахстан, купивший почти 85 тысяч унций (2,6 тонны).\n\nКрупнейший продавец золота по итогам февраля — Турция, реализовавшая на рынке свыше семи процентов золотого запаса — около 1,2 миллиона унций (37,3 тонны). Среди крупнейших продавцов драгоценного металла традиционно числится и Канада, входящая в топ-10 мировых производителей. Практически вся золотодобыча этой североамериканской страны идет на продажу. Банк Канады, один из основных игроков золотого рынка, оставляет у себя лишь символические 100 унций (чуть более трех килограммов).\n\nКрупными игроками среди центральных банков мира считаются также ФРС США, ЕЦБ и Резервный банк Австралии. Из компаний достаточно влиятельны UBS, Morgan Stanley, Goldman Sachs, Citibank.\n\nЗолото России\n\nВ целом, Банк России не оказывает существенного влияния на соотношение спроса и предложения на мировом рынке золота. К тому же в статистике МВФ не указано, у кого и в каких объемах ЦБ покупал золото.\n\nМожно предположить, что Банк России скупает драгметалл у российских производителей за российскую же валюту. Это делается, во-первых, для того, чтобы поддержать отечественных золотодобытчиков. Отраслевая организация — Союз золотопромышленников России — в апреле прошлого года обратилась к Центробанку с просьбой выкупить почти весь объем добытого в 2015 году драгметалла, 240 из 290 тонн. Таким образом промышленники рассчитывали компенсировать рост ставок по кредитам, вызванный жесткой политикой регулятора. Центробанк уже спасал золотодобытчиков, выкупив в 2014 году 171 тонну из добытых 288-ми. Остальные 76 тонн приобрели европейские банки.\n\nПроизводители золота еще в прошлом году попросили у Банка России помощи.\nДругая причина скупки золота — очевидное стремление нарастить резервы государства. В настоящее время их объем составляет около 390 миллиардов долларов. На золото приходится порядка 15 процентов — 1446,3 тонны. В течение трех-пяти лет Центробанк планирует увеличить резервы до 500 миллиардов долларов. В том числе и за счет золота.\n\nТихая гавань или черный вестник?\n\n«Золото хорошо тем, что оно любит плохие новости», — отмечает советник по макроэкономике гендиректора брокерского дома «Открытие» Сергей Хестанов. Этот актив обычно не приносит больших доходов. Единственный плюс золота, утверждает эксперт, — относительная надежность. В случае серьезных катаклизмов и резкого падения цены других активов золото, скорее всего, основную ценность сохранит. Поэтому, как правило, его скупают, чтобы застраховаться от всевозможных рисков. «Как ни забавно, за массированной скупкой золота центробанками, как правило, следует падение его цены», — отмечает эксперт.\n\nЭкономист Яков Миркин тоже рассматривает золото как актив, привлекающий инвесторов в кризис. «Как и другие металлы, золото имеет обратную динамику по отношению к курсу доллара. Но во время финансовых кризисов его цена ведет себя иначе: при падении товарных цен золото может начать расти, как это было в 2008-2009 годах. Золото как особый товар с "монетарным отпечатком" в этот момент может рассматриваться в качестве тихой гавани», — пишет он в своей книге «1971-2025: курсы валют, мировые цены на сырье, курсы акций». В кризис цена на желтый металл также может упасть, однако в сравнении с другими сырьевыми товарами темпы этого падения значительно ниже, в том числе из-за спроса. «Сейчас золото ведет себя так же, как и все металлы», — отметил экономист в беседе с «Лентой.ру».\n\nВ феврале золото можно было рассматривать как самый привлекательный актив: только за месяц цена на него подскочила более чем на 10 процентов. К 29 февраля тройская унция стоила 1233 доллара. С начала года драгметалл подорожал на 16 процентов. Это при том, что канзачейские облигации США выросли только на 2,9 процента, а сводный мировой фондовый индекс MSCI All-Country World снизился на 6,2 процента.\n\nОднако, по мнению экспертов, золото пойдет вниз. Согласно расчетам Миркина, снижение продлится до 2018 года, и до 2020 года цена будет колебаться в диапазоне от 370-400 до 880-930 долларов за тройскую унцию. Затем должно начаться восстановление, которое выведет цены на новые уровни: от 590-620 до 1380-1460 долларов за унцию в 2025-2027 годах.\n\nВложение в золото — не самый доходный вид инвестиций даже среди операций с другими драгоценными металлами. Спекулянты предпочитают серебро, поскольку колебания цен здесь динамичнее.\n\nОднако для российского Центробанка скупка российского золота — весьма выгодная операция: регулятор наращивает резервы, не тратя при этом валюту. Рубли, за которые металл приобретается у производителей, можно просто напечатать. Причем такая эмиссия, в отличие от схемы, предложенной советником президента России Сергеем Глазьевым, не раскачивает курс национальной валюты и не оказывает давления на потребительские цены. Кроме того, наращивание объемов золотого запаса позволяет лучше приготовиться к экономическому черному дню. Если он наступит, лучше иметь в резервах не только наличную иностранную валюту, но и полновесные золотые слитки. А как же канадцы, распродавшие практически весь свой запас? Монетарные власти страны слишком уверены в надежности своей экономики, чтобы запасаться золотыми «спасательными кругами».
9e626533-81f3-4d9e-b90d-95ef6e9946c3	Незаконно осужденная в России украинская летчица Надежда Савченко может вернуться домой через несколько недель.\n\nОб этом сообщил ее адвокат Илья Новиков в комментарии Радио Свобода.\n\nПо его словам, переговоры по ее возвращению в Украину ведутся, но существует юридическая возможность этапирования Савченко к месту лишения свободы.\n\n"Ее могут в любой момент вывезти. Я надеюсь, что российская власть понимает, что такое мероприятие будет рассматриваться всеми без исключения, не только украинской стороной, но и американцами, и европейцами как срыв предыдущих договоренностей. Надеюсь, что они не пойдут на такой шаг, потому что этапирование означает, что минимум на 2 недели, а может и дольше, мы просто потеряем любую информацию о ее местонахождении", - сказал Новиков.\n\nПо его словам, сейчас Савченко осматривают российские тюремные медики, но "нет никакой уверенности, что они будут заботиться о ее здоровье".\n\nНадежда Савченко с 6 апреля объявила сухую голодовку с требованием освобождения.\n\n5 апреля приговор российского суда по делу Надежды Савченко вступил в силу. Ее приговорили к 22 годам тюрьмы 22 марта, обвинив, в частности, в убийстве российских журналистов на Донбассе.\n\nНадежда Савченко обвинения отвергает и обещала 6 апреля начать новую сухую голодовку с требованием вернуть ее в Украину.\n\nРоссийские власти ранее заявляли, что решение о возможной передаче Савченко Украине может быть принято только после вступления в силу приговора по ее делу.
9bfb5243-81cd-4d73-8928-af253c2fe6bc	Всемирный банк ухудшил прогноз по динамике ВВП России в 2016 году. Международная организация ждет, что экономика сократится на 1,9 процента вместо 0,7 процента, которые прогнозировались ранее. Об этом говорится в апрельском докладе Всемирного банка.\n\nТакже более пессимистичен прогноз роста российской экономики в 2017 году: он ожидается в пределах 1,1 процента, а не 1,3 процента, как предполагалось ранее.\n\nПессимистичный сценарий Всемирного банка предусматривает падение средней цены нефти в текущем году до 30 долларов за баррель. В этом случае спад российской экономики составит 2,5 процента. При этом в 2017 году нефть может подорожать до 40 долларов за баррель, а в 2018-м — до 45 долларов. Это позволит ВВП вырасти на 0,5 процента в 2017 году, а в 2018-м — на 2 процента.\n\nПри этом, согласно всем предполагаемым сценариям, в нынешнем году ожидается дальнейшее повышение уровня бедности. «Прогнозируемый рост бедности во всех сценариях отчасти обусловлен сильным отрицательным эффектом переноса резкого сокращения реальных доходов в 2015 году в сочетании с продолжающимся ухудшением показателей занятости населения», — говорится в докладе.\n\nРеальные зарплаты будут сокращаться из-за высокого уровня инфляции, наряду с «нулевой» индексацией зарплат в бюджетных организациях и индексацией пенсий ниже инфляции.\n\n30 марта Центр развития ВШЭ опубликовал прогноз, согласно которому ВВП России сократится в 2015-2019 годах в общей сложности на 8,1 процента. Эксперты ВШЭ отметили, что имеющиеся тенденции «препятствуют отходу экономики со сложившейся депрессивной траектории». Кроме того, они предсказали сокращение зарплат бюджетников на 30 процентов.\n\nВ 2015 году российская экономика сократилась на 3,7 процента. Согласно прогнозу Альфа-банка, в 2016-м ВВП России упадет на 1,5 процента. МВФ ждет сокращения на 1 процент.
77cbdd43-a5e6-477f-8359-4b19f146ec32	В Кремле не согласились с высказываниями советника президента России Сергея Глазьева о грядущей экономической катастрофе. Об этом в среду, 6 апреля, рассказал пресс-секретарь президента России Дмитрий Песков, передает «Интерфакс».\n\n«Данное заявление является личной точкой зрения Глазьева и никоим образом не отражает позицию администрации президента РФ», — сказал пресс-секретарь главы государства.\n\nРанее в среду советник президента России Сергей Глазьев написал в своем микроблоге в Twitter, что в созданной Центробанком «новой реальности» выживают только спекулянты, производство при этом умирает. «Это путь к экономической катастрофе», — подчеркнул Глазьев.\n\nПо его мнению, при другой политике Центробанка российская экономика могла бы расти на 6-8 процентов ежегодно.\n\nВ интервью «Известиям», опубликованном 6 апреля, первый зампред Центробанка Ксения Юдаева предложила характеризовать текущую ситуацию термином «новая реальность» и не сосредотачиваться на слове «кризис». По словам Юдаевой, речь идет о «новых координатах, в которых нашей экономике предстоит развиваться», а не о временных трудностях.
a8ff13e6-cd52-49c0-897a-7252e23f96d0	Советник президента России Сергей Глазьев заявил, что в созданной Центробанком «новой реальности» выживают только спекулянты, производство при этом умирает. Об этом он написал в Twitter.\n\n«Это путь к экономической катастрофе», — подчеркнул Глазьев. Он добавил, что нынешняя конъюнктура — «это стагфляция (стагнация + инфляция — прим. «Ленты.ру»), прекратившая экономический рост».\n\n«Если бы не созданная политикой ЦБ "новая реальность", то российская экономика могла бы расти на 6-8 процентов в год», — считает советник Владимира Путина.\n\nВ интервью «Известиям», опубликованном в среду, 6 апреля, первый зампред Центробанка Ксения Юдаева сказала, что ситуация в экономике развивается лучше, чем можно было бы ожидать. Она отметила, что не концентрировалась бы на слове «кризис». «Нашу ситуацию лучше всего описывает термин "новая реальность", то есть это не временные трудности, а новые координаты, в которых нашей экономике предстоит развиваться», — констатировала первый зампред ЦБ.\n\nВ марте в Минфине заявили, что российская экономика прошла через резкое изменение внешних условий не так драматично, как другие страны. «Задышали те отрасли, которые в последние годы — годы высоких цен [на нефть] — находились в застое, так называемые неторгуемые отрасли», — отмечал глава министерства Антон Силуанов.
95635977-1d45-4e1a-8af5-373fb2fd4812	Адвокат Илья Новиков в ближайшие дни ожидает хороших новостей о судьбе своей подзащитной украинской летчицы Надежды Савченко, приговоренной российским судом к 22 годам заключения. Об этом сообщает «Интерфакс».\n\n«Есть информация, которую я не вправе раскрывать, но она также сводится к тому, что хорошие новости могут поступить в один из ближайших дней. Мы надеемся, что это будет рано, а не поздно», — заявил он в программе «Черное зеркало» в эфире телеканала «Интер».\n\nТакже Новиков сообщил, что, по его информации, Савченко в ближайшие дни по этапу не отправят.\n\n«Все-таки переговоры идут между Москвой и Киевом, и скажу осторожно, что они скорее движутся в правильную сторону, хотя и медленнее, чем нам хотелось бы. И на следующей неделе мы ждем каких-то принципиальных новостей. Я думаю, что все понимают, и в России в том числе, что попытка этапировать Надежду в текущей ситуации и в ее теперешнем состоянии будет фактически означать попытку срыва таких переговоров. Этого, я думаю, никто не хочет», — пояснил он.\n\nКроме того, Новиков напомнил, что Савченко голодает третьи сутки и у нее уже наблюдаются признаки обезвоживания. «Сухая очень кожа и начинают белеть слизистые оболочки, десна, язык», — рассказал он.\n\nНовиков добавил, что «начальник колонии предупредил ее, что скоро ее начнут кормить насильно». По словам Новикова, его подзащитная намерена помешать насильственному кормлению. «У нее на это свои планы, она считает, что сможет этому помешать», — сказал он.\n\n5 апреля приговор в отношении Савченко вступил в силу. Решение суда не было обжаловано по настоянию осужденной. 6 апреля летчица возобновила сухую голодовку.\n\n22 марта Донецкий суд в Ростовской области приговорил Савченко к 22 годам лишения свободы. Она была признана виновной в убийстве российских журналистов Игоря Корнелюка и Антона Волошина и в покушении на убийство их коллеги. Кроме того, суд оштрафовал ее на 30 тысяч рублей за незаконное пересечение границы России.\n\nВ день вынесения приговора президент Украины Петр Порошенко заявил, что готов обменять летчицу на двух россиян. Он не назвал конкретных имен, однако СМИ сообщали, что речь, вероятно, идет об Александре Александрове и Евгении Ерофееве, задержанных в мае 2015 года в Луганской области.\n
3312cb78-c035-4c43-a8ba-e86eb1527ac5	Несмотря на возможную отмену санкций уже в следующем году, восстановление российской экономики в условиях неблагоприятной конъюнктуры затянется, отмечают эксперты Всемирного банка. Они предупредили о рисках роста уровня бедности в России, ослабления рубля и увеличения дефицита бюджета.\n\nВсемирный банк опубликовал доклад, в котором в очередной раз пересмотрел основные показатели развития экономики России на ближайшие годы. Из-за падения мировых цен на нефть и введенных в 2014 году экономических санкций страна погрузилась в рецессию, пик которой пришелся на второй квартал 2015 года.\n\nОтмена санкций возможна уже 2017 году, предполагают в банке, но подчеркивают, что эффект от этого будет краткосрочным и незначительным. Эксперты придерживаются мнения, что действие санкций продлится до 2018 года.\n\nАдаптация российской экономики к низким мировым ценам на нефть произошла через падение доходов. Это характерно для всех стран-экспортеров сырья, темпы экономического роста которых существенно замедлились в последние годы, говорится в докладе банка.\n\nПри этом прогнозируемый рост нефтяных цен не предотвратит рост уровня бедности, которой вернется к показателям 2007 года, считают во Всемирном банке. И отмечают, что сырьевой перекос в экспорте России, усиливавшийся на протяжении десятилетий, подрывал конкурентоспособность экономики.\n\n«Экономическая политика, направленная на укрепление уверенности инвесторов, может существенно улучшить перспективы долгосрочного роста экономики России. Административные барьеры, высокие транспортные и логистические издержки и неравные условия для ведения бизнеса — все это отрицательно сказывается на инвестициях, особенно в несырьевых отраслях. В новом антикризисном плане правительства признается важность преодоления структурных ограничений», — констатируют эксперты международной организации.\n\nКроме того, аналитики банка сомневаются, что целевой показатель дефицита бюджета в 3 процента ВВП, заложенный на 2016 год, может быть выполнен (напомним, в сентябре 2015 года президент России Владимир Путин подчеркивал, что дефицит не должен превышать данную отметку). Средства Резервного фонда могут быть исчерпаны к концу текущего года, что потребует увеличения заимствований или дополнительной приватизации.\n\nТри пути\n\nПри сохранении антироссийских санкций возможны три сценария на 2016-2018 годы. Согласно базовому, в этом году российская экономика сокращается на 1,9 процента при среднегодовой цене на нефть около 37 долларов за баррель, в результате чего объем реального ВВП окажется существенно ниже уровня 2012 года. В 2017-м эксперты банка ожидают рост ВВП России на 1,1 процента при восстановлении нефтяных цен до 50 долларов за баррель.\n\nРанее, в декабре прошлого года, Всемирный банк прогнозировал сокращение экономики РФ в 2016 году на 0,7 процента при нефти по 50 долларов за баррель и рост на 1,3 процента при цене 53 доллара.\n\nВ оптимистичном сценарии — средняя цена нефти около 50 долларов за баррель, сокращение экономики на 0,7 процента в 2016 году, рост экономики в 2017-м на 1,7 процента при стоимости нефти в 53 доллара.\n\n«Однако негативный эффект последствий глубокой рецессии 2015 года сохранится на протяжении всего 2016-го, и рост потребления, согласно прогнозам, вернется в область положительных значений не раньше следующего года. С 2017-го и в дальнейшем основным двигателем экономического роста, как ожидается, будет рост инвестиционного спроса», — отмечается в докладе.\n\nПессимистичный сценарий предполагает сокращение экономики в 2016 году на 2,5 процента при среднегодовой стоимости нефти 30 долларов за баррель. В 2017 году рост экономики не превысит 0,5 процента при уровне цен на нефть 40 долларов.\n\n«Падение нефтяных цен приведет к дальнейшему обесценению рубля, что вызовет увеличение относительной стоимости импорта и соответствующее повышение потребительских цен», — предупреждают во Всемирном банке. В результате ЦБ может отложить смягчение денежно-кредитной политики до 2017 года.\n\nЗатянем пояса\n\nНемаловажны и прогнозы об уровне жизни населения. Всемирный банк считает, что рост уровня бедности в 2016 году неизбежен во всех сценариях, несмотря на быстрое восстановлении нефтяных цен. В результате благосостояние россиян откатится к показателям 2007 года. Россия в этом не одинока. Такова участь всех стран с сырьевой экономикой: «В последнее время наблюдается глобальная тенденция к росту доли бедного населения в странах с замедляющимися темпами экономического роста. В странах-экспортерах сырья, таких как Россия, достижения в области сокращения бедности, реализованные за последнее десятилетие, постепенно растрачиваются».\n\nСогласно базовому прогнозу, численность бедного населения в 2016 году увеличится еще на 1,1 миллиона человек (после прибавки в 3,1 миллиона человек в 2015 году) и достигнет 20,3 миллиона человек. «Ожидается самый значительный рост бедности после кризиса 1998-1999 годов — гораздо более значительный, чем во время глобального финансового кризиса 2008 года», — предупреждают во Всемирном банке.\n\nВ рамках пессимистичного сценария уровень бедности повысится до уровня 14,7 процента в 2016 году (21 миллион человек) и достигнет максимального значения в 15,2 процента в 2017-м.\n\nНекоторое повышение реальной заработной платы прописано в оптимистичном сценарии. Ожидается, что в 2017-м доля бедных останется на уровне 13,4 процента (близко к показателю 2015 года).\n\nТем не менее в 2018-м прогнозируется существенное улучшение динамики бедности: в базовом сценарии — снижение до 13,5 процента, в пессимистичном — до 14,8 процента. В оптимистическом сценарии через два года уровень бедности упадет до 12,6 процента.\n\nПустой резерв\n\nНаконец, в докладе Всемирного банка затронуты бюджетные проблемы России. Отмечается, что в течение 2016 года в этом аспекте сохранится неопределенность. В бюджет заложена нефть по 50 долларов за баррель (в среднем по году), и, скорее всего, правительству придется пересматривать расходную и доходную часть из-за падения котировок.\n\n«Меры правительства по консолидации представляются целесообразными в условиях невозможности поддержания сложившегося в последние годы уровня расходов на фоне падения нефтегазовых доходов», — говорится в материалах Всемирного банка. Доходы от нефтегазового сектора по-прежнему наполняют бюджет на 40 процентов, напоминают там.\n\nНесмотря на взятый в начале года курс на сокращение расходов, Россия вряд ли выполнит заложенный в бюджете-2016 целевой показатель дефицита в 3 процента ВВП. На этом фоне средства Резервного фонда будут исчерпаны к концу текущего года. Следовательно, стране придется наращивать внешний долг либо расширять программу приватизации.\n\nПессимистичный сценарий предусматривает дефицит консолидированного бюджета в 5,6 процента ВВП в 2016-м, 3,6 процента в 2017-м и 2,7 процента в 2018-м. Оптимистичный — сокращение дефицита бюджета до 0,9 процента ВВП в 2017-2018 годах.\n\nНа фоне публикации доклада Всемирного банка интересной выглядит заочная дискуссия помощника президента России Сергея Глазьева и Банка России. Председатель ЦБ Эльвира Набиуллина 7 апреля выступила с позитивным сообщением. Худшее позади, точка стабилизации близка — такова ее позиция. Глазьев в ответ призвал поставить Набиуллину к станку, чтобы она лично увидела все проблемы российской промышленности. Примечательно также, что министр экономического развития Алексей Улюкаев ранее говорил, что ВВП начнет восстанавливаться во втором квартале 2016 года. В ближайшие три месяца станет ясно, кто был ближе к истине.\n
5b9465f5-41c8-457e-9f05-9c866d8984ba	Ситуация в российской экономике остается непростой, но худшие опасения не реализовались. Об этом на съезде Ассоциации российских банков заявила председатель ЦБ Эльвира Набиуллина, передает РИА Новости.\n\n«Рецессия пока еще не закончилась, но экономика уже близка к точке стабилизации», — подчеркнула она.\n\nОна также сказала, что Банк России ожидает спада ВВП в 2016 году на 1,3-1,5 процента при нефти за 30 долларов. Об этом сообщает Rambler News Service.\n\nРанее 7 апреля министр финансов Антон Силуанов заявил, что Россия испытала самые серьезные за десятилетие экономические шоки. При этом он отметил, что правительству и Центробанку удалось снизить инфляцию и процентные ставки в экономике.\n\nВ 2015 году российская экономика сократилась на 3,7 процента. Согласно прогнозу Всемирного банка, в 2016-м ВВП России упадет на 1,9 процента. МВФ ждет сокращения на 1 процент.
8af4f212-a4cc-49cd-9828-777e93ae0459	Россия не будет размещать суверенные еврооблигации в текущем году. Из-за санкций, наложенных США и Евросоюзом несколько международных инвестиционных банков отказались участвовать в размещении. Об этом сообщает в понедельник, 18 апреля, агентство Bloomberg со ссылкой на двух высокопоставленных российских чиновников.\n\nХотя глава Минфина Антон Силуанов заявил накануне, что он все же надеется разместить бумаги, отсутствие авторитетных финансовых организаций среди андеррайтеров займа (специалисты, уполномоченные анализировать и оценивать все виды рисков при страховании) фактически делает невозможным создание адекватного спроса среди инвесторов.\n\nВ результате неудачи Минфина в привлечении заимствований на 3 миллиарда долларов у Кремля, помимо прочих трудностей, возникают проблемы с покрытием растущего бюджетного дефицита. В результате финансовое ведомство вынуждено будет увеличить внутренние заимствования и в большей степени рассчитывать на деньги от приватизации госкомпаний, которая в текущем году окажется самой масштабной с 2010 года.\n\nКроме того, не оправдались надежды Москвы на заключение сделки с основными нефтеэкспортерами о заморозке добычи на уровне января текущего года. Переговоры в катарской столице — Дохе провалились из-за отказа Ирана в них участвовать. Это обстоятельство усиливает давление на российский бюджет, рассчитанный исходя из цены на нефть в 50 долларов за баррель.\n\nО намерении России выйти на рынок внешних заимствований впервые с 2013 года заявил замминистра финансов Сергей Сторчак в октябре 2015 года. Причем ранее чиновник говорил, что Россия не обратится к внешним рынкам за заимствованиями пока не будут сняты санкции. Формально ограничения не распространяются на госзаймы, но фактически размещение оказалось невозможным из-за позиции инвестбанков.
9ee3f922-1ac8-4297-bd3f-4f3d1c809ca7	Нефтяные страны не смогли договориться о заморозке добычи, что привело к обвалу на валютном и сырьевом рынках. Аналитики, опрошенные «Лентой.ру», рассказали о том, как долго будет падать рубль, почему нефтяные котировки теперь зависят от США, Ирана и Ливии и как сохранить сбережения в условиях курсовых колебаний.\n\nИран топит рубль\n\nКак и ожидалось, провал переговоров о заморозке добычи нефти привел к падению нефтяных котировок и курса рубля.\n\nВ начале торгов на лондонской бирже ICE нефть марки Brent упала почти на 5 процентов, до 40,5 доллара за баррель. В пятницу, 15 апреля, за бочку эталонного сорта давали более 43 долларов. Техасская нефть WTI обвалилась ниже отметки 40 долларов за баррель — до 39,16. Данные о смеси ОПЕК пока не обновлялись: по сведениями на 15 апреля она стоит 38,05 доллара.\n\nРынок был разочарован итогами встречи в Дохе. Предполагалось, что у представителей нефтедобывающих государств была выработана общая позиция, раз уж они приехали в катарскую столицу. Но переговоры велись странно — сперва их отложили на несколько часов, затем еще шесть часов шли изнурительные торги (по выражению министра энергетики Казахстана Каната Бозумбаева). «В целом, конечно, мы ожидали, что договоримся. Мне казалось, что сюда приехали договариваться, а не обсуждать необходимость участия в этом процессе еще каких-то стран, которые сегодня не присутствовали», — рассказал по итогам встречи глава Минэнерго России Александр Новак. Камнем преткновения стала позиция Саудовской Аравии, отказавшейся подписывать какие-либо договоры без участия Ирана. А представители Исламской Республики вообще не прибыли в Доху.\n\nТорги на Московской бирже также стартовали с обвала. Доллар вырос сразу на 2 рубля, до 68,30 рубля, евро — на 2,17 рубля, до 77,12.\n\nТем не менее негатив первых часов после объявления об итогах переговоров несколько сошел на нет. К 13:00 мск Brent подросла до 42 долларов за баррель (но это все равно на 2,6 процента ниже, чем в конце сессии 15 апреля), американская валюта опустилась до 67,37 рубля, единая европейская — до 76,19.\n\nМногие аналитики предрекают российской валюте крах: нефть опустится ниже 30 долларов за баррель, а доллар пробьет отметку в 80 рублей. Но есть и более сдержанные прогнозы: эффект от встречи в Катаре будет кратковременным, а нефтяные котировки и курс рубля вернутся к зависимости от фундаментальных факторов.\n\nОпять 75\n\nАналитик Райффайзенбанка Денис Порывай в беседе с «Лентой.ру» отметил, что цены на нефть уже отреагировали на итоги дохийских переговоров существенным падением. По его словам, обвал мог бы быть еще более значительным, если бы не забастовка нефтяников в Кувейте, протестовавших против урезания зарплат и льгот. Это совпало с саммитом в Катаре и привело к кратковременному, но резкому падению добычи в стране — с 2,8 миллиона до 1,1 миллиона баррелей в сутки. Выпавший из производства объем как раз соответствует существующему избытку на рынке.\n\n«До предстоящей встречи (по словам министра энергетики Нигерии Эммануэля Ибе Качикву, следующий раунд переговоров состоится в июне — прим. «Ленты.ру») основными факторами для котировок должны стать данные о запасах и добыче нефти в США», — считает эксперт. По его мнению, если добыча сланцевой нефти в Соединенных Штатах не сократится, то нефть может спикировать ниже 30 долларов за баррель.\n\nТекущий курс рубля справедливо отражает стоимость нефти. Во втором квартале ослабление национальной валюты произойдет под влиянием сезонных факторов — в частности, более низкого сальдо текущего счета (будет наращиваться импорт, а компании начнут выплачивать дивиденды). «Мы ожидаем, что курс достигнет 70 рублей за доллар ближе к концу второго квартала. При падении нефтяных котировок до 35 долларов американская валюта подорожает до 75 рублей», — заключил Денис Порывай.\n\nДиректор аналитического департамента инвестиционной компании «Golden Hills-КапиталЪ АМ» Михаил Крылов подчеркивает, что переговоры в Дохе не изменили расстановку сил на рынке. «Они не вели к перелому в сторону повышающегося спроса и дефицита предложения. Но ни в том, что стороны не договорились о заморозке, ни в иранском неучастии в решении этой важной проблемы не было никакой катастрофы», — говорит он. И подчеркивает, что пара доллар/рубль сейчас сильнее зависит от дефицита бюджета и пополнения валютных резервов государства.\n\nВажно понимать, что государству выгодна относительно слабая национальная валюта. Это решает сразу две важные задачи: поддерживает экспортеров и экономику на плаву и позволяет пополнять бюджет. О том, как слабый рубль поддерживает государство говорили, например, вице-премьер Аркадий Дворкович и председатель Банка России Эльвира Набиуллина. Примечательно, что в случае укрепления российской валюты Минфин намерен сознательно играть против нее. По словам министра финансов Антона Силуанова, при дорогих углеводородах лишние доходы направят в резервы, что не позволит рублю сильно подняться относительно доллара.\n\nМихаил Крылов допускает, что доллар подорожает до 73 рублей. «Если есть деньги, не нужные для текущих расходов, лучше держать их в иностранной валюте», — рекомендует он.\n\n«На мой взгляд, рынок энергоносителей отыграет переговоры в Дохе в ближайшие несколько недель. Однако для рынка также важны и сопутствующие факторы», — утверждает аналитик группы компаний «Финам» Богдан Зварич. По его мнению, игроки будут следить за динамикой запасов и добычи в США, а также за ростом экспорта нефти из Ирана и Ливии.\n\nОбе эти страны входят в ОПЕК и обе не присутствовали на переговорах в Дохе 17 апреля. Тегеран намерен нарастить добычу до 4 миллионов баррелей в день, Триполи — до 2 миллионов. Там заняты решением собственных проблем и не намерены урезать растущее производство черного золота.\n\n«Если эти факторы добавят негатива на рынок, снижение может оказаться достаточно продолжительным и привести к новым годовым минимумам. В ближайшее время нефть марки Brent способна уйти ниже уровня 40 долларов за баррель, что ослабит российскую валюту. Доллар может подняться выше 70 рублей», — считает Богдан Зварич.\n\nВ ближайшее время курс доллара может вернуться в диапазон 70-75 рублей. Это случится, если нефтяные котировки упадут до 35-40 долларов за баррель. При этом стоимость нефти окажется в зависимости от статистики из США, Ирана и Ливии.\n
64423a11-dcdc-4e95-9f09-e8c8a53b37fd	Безвизовый режим позволит вернуться в страну сотням тысяч украинцев, которые сейчас не имеют такой возможности.\n\nОб этом заявил президент Украины Петр Порошенко в интервью украинским телеканалам, которое вышло в эфир вечером 24 апреля.\n\nГоворя об ожидаемом введении безвизового режима, Порошенко выразил уверенность, что этот процесс "на финишной прямой".\n\nОн напомнил, что президент Европарламента Мартин Шульц заверил, что в Европе будут делать все, чтобы ускорить принятие решения предоставить Украине безвизовый режим в Европарламенте.\n\n"Уверен, что во второй половине 2016-го украинцы должны ездить в ЕС по своему биометрическому паспорту, а безвизовый режим Украине будет предоставлен. 100%", - отметил Порошенко.\n\nПри этом президент выразил уверенность, что безвизовый режим не повлечет массового оттока граждан из страны, а наоборот, даст возможность многим из них вернуться в Украину.\n\n"Сотни тысяч украинцев, которые сейчас находятся в странах ЕС наконец смогут вернуться в Украину, потому что им не будет нужно искать визы и пути, чтобы видеться с семьями, детьми ...", - отметил Порошенко.\n
\.


